//home
import metaNews from './thumbnails/thumbnail_meta_news.webp'
import vr4g from './thumbnails/thumbnail_vr4g.webp'
import rbs from './thumbnails/thumbnail_rbs_uth.webp'
import rsvp from './thumbnails/thumbnail_rsvp.webp'
import metaverse from './projects/metaverse/metaverse.png'
import headshot from './about/about_headshot.webp'

//thumbnails
import iptThumbnail from './thumbnails/ipt_thumbnail.webp'
import cvThumbnail from './thumbnails/cv_thumbnail.webp'

//ipt
import iptBanner from './projects/interactiveProductTour/ipt_banner.webp'
import iptDefault from './projects/interactiveProductTour/ipt_default.webp'
import iptHeadset from './projects/interactiveProductTour/ipt_headset.webp'
import iptHeadsetHotspot from './projects/interactiveProductTour/ipt_headset_hotspot.webp'
import iptController from './projects/interactiveProductTour/ipt_controller.webp'
import iptControllerHotspot from './projects/interactiveProductTour/ipt_controller_hotspot.webp'

//cv
import cvBanner from './projects/communityVoicesHub/cv_banner.webp'
import cvCarouselDesktop from './projects/communityVoicesHub/cv_carousel_desktop.webp'
import cvCarouselMobile from './projects/communityVoicesHub/cv_carousel_mobile.webp'
import cvHeroDesktop from './projects/communityVoicesHub/cv_hero_desktop.webp'
import cvHeroMobile from './projects/communityVoicesHub/cv_hero_mobile.webp'
import cvIntroDesktop from './projects/communityVoicesHub/cv_intro_desktop.webp'
import cvIntroMobile from './projects/communityVoicesHub/cv_intro_mobile.webp'
import cvOutroDesktop from './projects/communityVoicesHub/cv_outro_desktop.webp'
import cvOutroMobile from './projects/communityVoicesHub/cv_outro_mobile.webp'


export const Media = [
    {
        key: 0,
        src: metaNews
    },
    {
        key: 1,
        src: vr4g
    },
    {
        key: 2,
        src: rbs
    },
    {
        key: 3,
        src: rsvp
    },
    {
        key: 4,
        src: headshot
    },
    {
        key: 5,
        src: metaverse
    },
]

export const ThumbnailMedia = [
    {
        key: 0,
        src: iptThumbnail
    },
    {
        key: 1,
        src: cvThumbnail
    },
]

export const BannerMedia = [
    {
        key: 0,
        src: iptBanner
    },
    {
        key: 1,
        src: cvBanner
    },
]

export const InteractiveProductTourMedia = [
    {
        key: 0,
        src: iptDefault
    },
    {
        key: 1,
        src: iptHeadset
    },
    {
        key: 2,
        src: iptController
    },
    {
        key: 3,
        src: iptHeadsetHotspot
    },
    {
        key: 4,
        src: iptControllerHotspot
    },
]

export const CommunityVoicesHubMedia = [
    {
        key: 0,
        src: iptDefault
    },
    {
        key: 1,
        src: iptHeadset
    },
    {
        key: 2,
        src: iptController
    },
    {
        key: 3,
        src: iptHeadsetHotspot
    },
    {
        key: 4,
        src: iptControllerHotspot
    },
]
